import React, { useState } from 'react';
import { TextField, Button, Checkbox, FormControlLabel, Box, AppBar, Toolbar, IconButton, Typography, Drawer, List, ListItem, ListItemButton, ListItemIcon, ListItemText } from '@mui/material';
import MenuIcon from '@mui/icons-material/Menu';
import InboxIcon from '@mui/icons-material/MoveToInbox';
import MailIcon from '@mui/icons-material/Mail';
import { useNavigate } from 'react-router-dom';

function CustomSignInForm({ onSubmit }) {
  const [drawerOpen, setDrawerOpen] = useState(false);
  const navigate = useNavigate();

  const handleSubmit = (event) => {
    event.preventDefault();
    const formData = new FormData(event.currentTarget);
    onSubmit(formData);
  };

  const handleNavigation = (path) => {
    navigate(path);
    setDrawerOpen(false);
  };

  const DrawerList = (
    <Box sx={{ width: 250 }} role="presentation">
      <List>
        {[
          { text: 'Connectez-vous', path: '/Utilisateurs' },
      
        ].map((item, index) => (
          <ListItem key={item.text} disablePadding>
            <ListItemButton onClick={() => handleNavigation(item.path)}>
              <ListItemIcon>
                {index % 2 === 0 ? <InboxIcon /> : <MailIcon />}
              </ListItemIcon>
              <ListItemText primary={item.text} />
            </ListItemButton> 
          </ListItem>
        ))}
      </List>
    </Box>
  );

  return (
    <div>
      <AppBar position="static" color="primary">
        <Toolbar>
          <IconButton
            edge="start"
            sx={{ mr: 2 }}
            color="inherit"
            aria-label="menu"
            onClick={() => setDrawerOpen(true)}
          >
            <MenuIcon />
          </IconButton>
          <Typography variant="h6" color="inherit" component="div">
            Connexion
          </Typography>
        </Toolbar>
      </AppBar>

      <Drawer
        anchor="left"
        open={drawerOpen}
        onClose={() => setDrawerOpen(false)}
      >
        {DrawerList}
      </Drawer>

      <Box 
        component="form" 
        onSubmit={handleSubmit} 
        noValidate 
        sx={{ 
          display: 'flex', 
          flexDirection: 'column', 
          alignItems: 'center',
          gap: 2,
          mt: 4
        }}
      >
        <TextField
          size="small"
          sx={{ width: '250px' }}
          required
          id="email"
          label="Email"
          name="email"
          autoComplete="email"
          autoFocus
        />
        <TextField
          size="small"
          sx={{ width: '250px' }}
          required
          id="FirstName"
          label="Prénom"
          name="FirstName"
        />
        <TextField
          size="small"
          sx={{ width: '250px' }}
          required
          id="LastName"
          label="Nom"
          name="LastName"
        />
        <TextField
          size="small"
          sx={{ width: '250px' }}
          required
          name="password"
          label="Mot de passe"
          type="password"
          id="password"
          autoComplete="current-password"
        />
        <FormControlLabel
          control={<Checkbox value="remember" color="primary" />}
          label="Se souvenir de moi"
        />
        <Button
          type="submit"
          variant="contained"
          sx={{ width: '250px' }}
        >
          Connexion
        </Button>
      </Box>
    </div>
  );
}

export default function CustomSignInPage() {
  const navigate = useNavigate();

  const handleSubmit = (formData) => {
    const email = formData.get('email');
    const password = formData.get('password');
    
    // Vérifiez les identifiants (à remplacer par votre propre logique d'authentification)
    if (email === 'luchino@gmail.com' && password === '6Alamaison') {
      // Connexion réussie, rediriger vers la page d'accueil
      navigate('/Accueil');
    } else {
      // Connexion échouée, afficher un message d'erreur
      alert('Identifiants incorrects.');
    }
  };

  return <CustomSignInForm onSubmit={handleSubmit} />;
}
